import styled from 'styled-components';
import { ReactComponent as Wave } from '../../assets/wave.svg';

export const SvgWrapper = styled.div`
	svg {
	}
`;
export const Waves = styled(Wave)`
	display: block;

	width: 100%;
	height: 100px;
	.rect {
		fill: grey;
		width: 100%;
		height: 100%;
		color: white;
	}
`;
